import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <h2>안녕 리액트</h2>
          진짜 망해서 할 말이 없다
      </header>
    </div>
  );
}

export default App;
